"Magnit delivery" is an application for home delivery of groceries from Magnit. For residents of Moscow and Krasnodar. Magnit is now at your home!

In the application:
• no more heavy packages – we will bring purchases directly to the door and hand them over without contact;
• we will select goods as for ourselves. And if something is out of stock – we will offer a worthy replacement!

In the new application "Magnit Delivery" you can:
• order groceries from 5,000 names with home delivery in Moscow and 25,000 names with home delivery in Krasnodar
• pay for the order by card in the application;
• register and store order history;
• receive push notifications with order status;
Also you can set up notifications, read privacy policies and contact support in personal account.

Delivery terms in Moscow:
• within 60 minutes within the MKAD;
• daily from 8:00 to 22:00;
• delivery cost from 49 rubles and free for orders over 999 rubles;
• weight limit – 30 kg.

Delivery terms in Krasnodar:
• after 3 hours at the same day, or at 60 min time interval 
• daily from 10:00 to 22:00;
• minimum order amount is 500 rubles;
• delivery cost 199 rubles and free for orders over 3000 rubles; 
• weight limit – 50kg.

Смайлфуд - круглосуточная доставка еды.
В нашем онлайн-ресторане вы сможете заказать суши и пиццу, бургеры, супы, салаты, конструкторы блюд, десерты и бар. Смайлфуд - это все, что нужно для создания особого момента!

Заказать доставку еды домой или в офис можно через наше мобильное приложение, через колл-центр или на сайте:
В Одессе: smilefood.od.ua
В Херсоне: smilefood.ks.ua
В Николаеве: smilefood.mk.ua
В Запорожье: smilefood.zp.ua

Работаем круглогодично, без выходных! 10 филиалов по Украине! Специальные предложения и выгодные акции! Бесплатная доставка от 199 грн!

Мы все время развиваемся и рассчитываем на вашу помощь в этом. Вы можете оставить отзыв о работе нашего онлайн-ресторана и мы точно услышим Ваше предложение или пожелание!

Мобильное приложение Smilefood позволяет:

- Узнавать, что же у нас вкусненького в меню;
- Быстро и удобно оформлять заказы;
- Узнавать о специальных предложениях;
- Отслеживать свою историю заказов;
- Оставлять отзывы;

Онлайн-ресторан Смайлфуд - мы делаем моменты особенными!

Якитория это не только первое демократичное японское кафе в Москве, но и быстрая доставка еды. Проголодались? Закажите доставку суши, роллов, пиццы, бургеров и пасты на дом или в офис в нашем бесплатном приложении. Пара касаний – и заказ уже готовится.

Преимущества приложения Якитория:
• скидка на первый заказ по промокоду FIRST
• онлайн оплата заказа;  
• возможность оформления предварительного заказа;
• выбор удобного способа получения заказа; 
• скидка 20% при самовывозе заказа из кафе; 
• отслеживание статуса заказа; 
• сохранение истории всех заказов; 
• карта с координатами ближайших кафе; 
• ваши избранные блюда.
• программа лояльности с вкусными подарками.

Сумма минимального заказа – 990 рублей с учетом всех скидок. Заказы принимаются с 10:00 до 04:45

Доставка осуществляется по г. Москве и ближнему Подмосковью, Воронеж, Тверь, Пенза, Екатеринбург. 
Время доставки: По Москве - 45минут, по остальной территории время доставки можно посмотреть на нашей карте.*

